[[questions]]
id = "PAVFR013"
question = "Vilka organisationer har inventerat flodpärlmusslor i Enningdalsälven, Kolarebäcken, Sollumsån, Verkälven, Tattarströmmarna och Önnarp under sommaren 2013?"
