id = "PAVFR050"
question = "Hur hanterade SAS sina finansiella kriser 2009 och 2012?"
answer = "Flygbolaget SAS som genomgått två stora finansiella kriser under år 2009 och 2012 där ledningen båda gångerna har haft en avgörande betydelse för att bolaget ska lyckas vända situationen, bland annat genom god kommunikation och tydliga strategier från ledningens sida"
