question = "Hur använder galleristerna patos för att behaga sina kunder enligt Lindholms (2007) studie?"
answer = "När de vill lyfta fram sina verksamheter tar de stöd av etos argument, men när de vill behaga sina kunder använder de patos för att ge kunderna upplevelsen av en avslappnad och behaglig miljö i gallerierna"
